import React,{useS} from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

function Doctorx() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [name, setName] = useState("");
  const [patientid, setPatientid] = useState("");

  const addToList = () => {
    Axios.post("http://localhost:5000/signup-patient", {
      email: email,
      password: password,
      name: name,
      patientid: patientid,
    });
  };
  return (
    <>
      <h1 style={{ fontFamily: "sans-serif" ,textAlign:"center" }}>Doctor SignUp!!</h1>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "50vh",
          width: "140vh 140vh",
          border: "1px solid gray", 
          margin: "100px 240px 100px 240px", 
        }}
      >
        <Form>
          <Row>
          <Form.Group className="mb-3" controlId="formBasicEmail" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>Email</Form.Label>
            <Form.Control
              type="email"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formBasicPassword" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              Password
            </Form.Label>
            <Form.Control
              type="password"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formBasicPassword" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              doctorId
            </Form.Label>
            <Form.Control
              type="text"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>
          
          <Form.Group className="mb-3" controlId="formBasicPassword" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>Name</Form.Label>
            <Form.Control
              type="text"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>
          </Row>
          <Row>
          <Form.Group className="mb-3" controlId="formBasicPassword" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              mobileNum
            </Form.Label>
            <Form.Control
              type="text"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formBasicPassword" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              address
            </Form.Label>
            <Form.Control
              type="text"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formBasicPassword" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              experience
            </Form.Label>
            <Form.Control
              type="text"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="formBasicPassword" as={Col}>
            <Form.Label style={{ fontFamily: "sans-serif" }}>
              specialisation
            </Form.Label>
            <Form.Control
              type="text"
              style={{
                height: "50px",
                borderColor: "black",
                borderWidth: "1px",
              }}
            />
          </Form.Group>

          </Row>

          <div
            style={{
              display: "flex",
              justifyContent: "space-between",
              marginTop: "20px", 
            }}
          >
            <Button
              variant="dark"
              type="submit"
              size="lg"
              style={{ fontFamily: "sans-serif" }}
            >
              SignUp
            </Button>
            <Button
              variant="dark"
              type="submit"
              size="lg"
              style={{ fontFamily: "sans-serif" }}
            >
              Login
            </Button>
          </div>
        </Form>
      </div>
    </>
  );
}

export default Doctorx;
